  const canon = 'GET
/' + bucket + '/' + objEnc + '
' + qs + '
host:' + host + '

host
UNSIGNED-PAYLOAD';
  const sts = 'GOOG4-RSA-SHA256
' + dt + '
' + scope + '
' + crypto.createHash('sha256').update(canon).digest('hex');
  const sg = crypto.createSign('RSA-SHA256');
  sg.update(sts);
